  //       })
  //       .catch((error) => {
  //         console.log(error);
  //         alert("hata.");
  //       });
  //   }
  // };

  return (
    <div>
      <HeaderComponent />
      <NavbarComponent />
      <div class="container uyecerceve">
        <div class="member-title">ADRES DÜZENLE</div>
        <div class="centerForm">
          <form
            onSubmit={UserLogin}
            class="form-horizontal col-sm-offset-2 col-sm-7"
          >
            <div class="form-group">
              <label class="control-label col-sm-2" for="email">
                Email
              </label>
              <input
                type="email"
                class="form-control"
                name="mail"
                id="mail"
                placeholder=""
                required
                onChange={handleMail}
              ></input>
            </div>

            <div class="form-group">
              <label class="control-label col-sm-2 marginTop-10" for="pwd">
                Şifre
              </label>
              <input
                type="password"
                class="form-control"
                name="password"
                id="password"
                placeholder=""
                required
                onChange={handlePassword}
              ></input>
            </div>

            <div class="form-group sideBySide">
              <div class="col-sm-offset-2 col-sm-4">
                <div class="checkbox">
                  <label>
                    <input type="checkbox" /> Beni hatırla
                  </label>
                </div>
              </div>

              <div
                class="col-sm-offset-2 col-sm-4"
                style={{ textAlign: "center" }}
              >
                <label class="sifre-unut">
                  <a href="/Register">Hala hesabınız yok mu ?</a>
                </label>
              </div>
              <div
                class="col-sm-offset-2 col-sm-4"
                style={{ textAlign: "right" }}
              >
                <label class="sifre-unut">
                  <a href="/ForgotPassword">Şifremi Unuttum</a>
                </label>
              </div>
            </div>

            <div class="btnuye-div">
              <button
                type="submit"
                name="submit"
                class="btn btn-default btnuye btn-block"
              >
                <AiFillSave style={{ marginRight: 10 }} />
                Güncelle
              </button>
            </div>
          </form>
        </div>
      </div>

      <FooterComponent />
    </div>
  );
}

export default AddressDetail;
